AD_TAB.HQLWHERECLAUSE:
(e.id in (select coalesce(a.id,'') as id from Efin_Budgetadj a join a.nextRole r join r.eutNextRoleLineList l where l.role.id=@#AD_Role_ID@ and a.documentStatus <>'DR') or (e.id in (select b.efinBudgetadj.id from Efin_Budgetadj_Hist b where b.createdBy.id =@AD_User_ID@ and b.role.id=@#AD_Role_ID@ ) ) or ( e.createdBy.id=@AD_User_ID@ or e.role.id = @#AD_Role_ID@) or (e.id in (
select req.id from Efin_Budgetadj req join req.nextRole rl2 join rl2.eutNextRoleLineList li2 where li2.role.id in (select li.role.id from Efin_Budgetadj re join re.nextRole rl join rl.eutNextRoleLineList li ) and 1=( select 1 from Eut_Docapp_Delegate dl join dl.eutDocappDelegatelnList dll where dll.userContact.id=@#AD_User_ID@ and dll.role.id = @#AD_ROLE_ID@ and dll.documentType='EUT_119' and now() between dl.fromDate and dl.date and dl.role.id in ( select li.role.id from Efin_Budgetadj re join re.nextRole rl join rl.eutNextRoleLineList li ))
)) or @EFIN_FinanceAdmin@='Y')
